import React, { useState, useEffect } from 'react';
import { Card, Typography, Form, Input, Button, Divider } from 'antd';
import { CompanyInfo } from '../App';
import './CertificatePreview.css';

const { Title, Text } = Typography;

interface CertificatePreviewProps {
  companyInfo: CompanyInfo;
}

const CertificatePreview = ({ companyInfo }: CertificatePreviewProps) => {
  // 生成ID号码
  const generateIdNumber = () => {
    const randomNum = Math.floor(10000000 + Math.random() * 90000000);
    return `${randomNum}`;
  };

  // 生成文档编号
  const generateDocumentNumber = () => {
    const date = new Date();
    const year = date.getFullYear();
    const randomNum = Math.floor(10000 + Math.random() * 90000);
    return `${year}${randomNum}`;
  };

  // 获取格式化日期时间
  const getFormattedDateTime = () => {
    const date = new Date();
    const month = String(date.getMonth() + 1).padStart(2, '0');
    const day = String(date.getDate()).padStart(2, '0');
    const year = date.getFullYear();
    const hours = String(date.getHours()).padStart(2, '0');
    const minutes = String(date.getMinutes()).padStart(2, '0');
    const ampm = date.getHours() >= 12 ? 'PM' : 'AM';
    
    return `${month}/${day}/${year} ${hours}:${minutes} ${ampm}`;
  };

  // 生成费用
  const getFee = () => {
    return '$50.00';
  };

  return (
    <div className="certificate-container">
      <div className="certificate-preview-section">
        <div className="colorado-certificate">
          <div className="colorado-header">
            <div className="colorado-logo-container">
              <div className="colorado-logo"></div>
              <div className="colorado-title">
                <h2>Colorado</h2>
                <h3>Secretary of State</h3>
              </div>
            </div>
            <div className="colorado-info-box">
              <div className="colorado-info-item">
                <span className="info-label">ID#:</span>
                <span className="info-value">{generateIdNumber()}</span>
              </div>
              <div className="colorado-info-item">
                <span className="info-label">Document#:</span>
                <span className="info-value">{generateDocumentNumber()}</span>
              </div>
              <div className="colorado-info-item">
                <span className="info-label">Filed on:</span>
                <span className="info-value">{getFormattedDateTime()}</span>
              </div>
              <div className="colorado-info-item">
                <span className="info-label">Fees:</span>
                <span className="info-value">{getFee()}</span>
              </div>
            </div>
          </div>
          
          <div className="colorado-document-title">
            <h1>Articles of Incorporation for a Profit Corporation</h1>
            <p>filed pursuant to § 7-102-101 and § 7-102-102 of the Colorado Revised Statutes (C.R.S.)</p>
          </div>
          
          <div className="colorado-content">
            <div className="colorado-content-item">
              <div className="content-label">The domestic entity name of the corporation is</div>
              <div className="content-value">{companyInfo.companyName || 'Fineparts trading INC'}</div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The principal office street address is</div>
              <div className="content-value address-value">
                {companyInfo.address.split(',')[0] || '418 Broadway # 6438'}<br/>
                {companyInfo.address.split(',').slice(1).join(',').trim() || 'Albany NY 12207'}<br/>
                US
              </div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The principal office mailing address is</div>
              <div className="content-value address-value">
                {companyInfo.address.split(',')[0] || '418 Broadway # 6438'}<br/>
                {companyInfo.address.split(',').slice(1).join(',').trim() || 'Albany NY 12207'}<br/>
                US
              </div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The name of the registered agent is</div>
              <div className="content-value">Rocky Mountain RA LLC</div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The registered agent's street address is</div>
              <div className="content-value address-value">
                110 16th Street, Suite 1460<br/>
                Denver CO 80202<br/>
                US
              </div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The registered agent's mailing address is</div>
              <div className="content-value address-value">
                110 16th Street, Suite 1460<br/>
                Denver CO 80202<br/>
                US
              </div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-value">The person above has agreed to be appointed as the registered agent for this entity.</div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The name(s) and address(es) of the incorporator(s)</div>
              <div className="content-value incorporator-value">
                {companyInfo.ownerName || 'Yifan Pei'}<br/>
                {companyInfo.address.split(',')[0] || '418 Broadway # 6438'}<br/>
                {companyInfo.address.split(',').slice(1).join(',').trim() || 'Albany NY 12207'}<br/>
                US
              </div>
            </div>
            
            <div className="colorado-content-item">
              <div className="content-label">The classes of shares and number of shares of each class that the corporation is authorized to issue are</div>
              <div className="content-value">
                The corporation is authorized to issue:<br/>
                Common shares - 1000
              </div>
